import React, { useState, useEffect } from 'react';
import { Typography, List, ListItem, ListItemText, Box, Container } from '@mui/material';
import axios from 'axios';

interface Stock {
  id: number;
  symbol: string;
  name: string;
}

const StockMonitoring: React.FC = () => {
  const [stocks, setStocks] = useState<Stock[]>([]);

  useEffect(() => {
    const fetchStocks = async () => {
      try {
        const response = await axios.get('/api/');
        setStocks(response.data);
      } catch (error) {
        console.error('Fetch stocks error:', error);
      }
    };

    fetchStocks();
  }, []);

  return (
    <Container maxWidth="md">
      <Box sx={{  marginTop: 4, textAlign:  'center', backgroundColor:'GrayText'}}>


    <div>
      <Typography variant="h4" gutterBottom>Stock Monitoring Dashboard</Typography>
      <List>
        {stocks.map(stock => (
          <ListItem key={stock.id}>
            <ListItemText primary={stock.name} secondary={stock.symbol} />
          </ListItem>
        ))}
      </List>
    </div>
    </Box>
    </Container>
  );
};

export default StockMonitoring;
